249: @Test public void dropsDuplicateAttributes() {
250: // case sensitive, so should drop Four and Five
251: String html = "<p One=One ONE=Two one=Three One=Four ONE=Five two=Six two=Seven Two=Eight>Text</p>";
252: Parser parser = Parser.xmlParser().setTrackErrors(10);
